import { useState } from 'react'
import './AddChannel.css'


export function AddChannel(props){
    const [id, setId] = useState("");


    function handle(){
        console.log("chat");
        axios(`https://${REST}/api/dm`, {
            method : "post",
            params : {
                id: accessToken.sub,
                to: friend
            },
            withCredentials: true  // 쿠키 및 인증 헤더를 포함하여 요청
        }).then((res) => { 
                console.log(res);
                nav(`channel/${props.server}/${res.data}`)
                return;
        }).catch((err) => { 
                console.log(err);
                return;
        });
          
        console.log(id + props.server);
    }
    return(
        <div className="AddChannel">
            <div>
                서버명 : <input value={id} onChange={(e) => setId(e.target.value)}></input>
            </div>
                <button onClick={() => handle()}>만들기</button>
        </div>

    )
}
